import { Link } from "react-router-dom"

const list = [
  { path: 'kijowska', title: 'Kijowska', fullTitle: 'Ektenia wielka Ki' },
  { path: 'sofijska', title: 'Sofijska' },
  { path: 'archangielski', title: 'Archangielski' },
]

export const Ectenias = ({ setElement }) => {
  return (
    <>
      <ul className="library">
        <li className="library__element">
          <Link 
            to={list[0].path} 
            className="itemLink"
            onClick={() => setElement(list[0])}
          >
            {list[0].title}
          </Link>
          <Link 
            to={list[1].path} 
            className="itemLink"
            onClick={() => setElement(list[1])}
          >
            {list[1].title}
          </Link>
          <Link 
            to={list[2].path} 
            className="itemLink"
            onClick={() => setElement(list[2])}
          >
            {list[2].title}
          </Link>
        </li>
      </ul>
    </>
  )
}
